from dataclasses import dataclass

@dataclass
class Triple:
    subject: str
    predicate: str
    object: str

# EVOLVE-BLOCK-START

def predict(triples: list[Triple]) -> str:
    sentence = ""
    airport = None
    facts = []

    for triple in triples:
        if triple.predicate == "cityServed":
            facts.append(f"{triple.subject} serves {triple.object}")
        elif triple.predicate == "country":
            facts.append(f"{triple.subject} is in {triple.object}")
        elif triple.predicate == "capital":
            facts.append(f"The capital of {triple.subject} is {triple.object}")
        elif triple.predicate == "elevationAboveTheSeaLevel":
            facts.append(f"{triple.subject} is {triple.object} meters above sea level")
        elif triple.predicate == "location":
            facts.append(f"{triple.subject} is located in {triple.object}")
        elif triple.predicate == "operatingOrganisation":
            facts.append(f"{triple.subject} is operated by {triple.object}")
        elif triple.predicate == "runwayLength":
            facts.append(f"{triple.subject} has a runway length of {triple.object} meters")
        elif triple.predicate == "runwayName":
            facts.append(f"The runway at {triple.subject} is named {triple.object}")
        elif triple.predicate == "1stRunwayLengthFeet":
            facts.append(f"{triple.subject} has a first runway length of {triple.object} feet")
        elif triple.predicate == "1stRunwaySurfaceType":
            facts.append(f"The first runway surface at {triple.subject} is {triple.object}")
        elif triple.predicate == "icaoLocationIdentifier":
            facts.append(f"The ICAO identifier for {triple.subject} is {triple.object}")
        elif triple.predicate == "iataLocationIdentifier":
            facts.append(f"The IATA identifier for {triple.subject} is {triple.object}")
        elif triple.predicate == "nativeName":
            facts.append(f"{triple.subject} is also known as {triple.object}")
        else:
            facts.append(f"{triple.subject} - {triple.predicate} - {triple.object}")

    if facts:
        if len(facts) == 1:
            sentence = facts[0] + "."
        elif len(facts) == 2:
            sentence = facts[0] + " and " + facts[1] + "."
        else:
            sentence = ", ".join(facts) + "."
    else:
        sentence = "No information available."

    return sentence

